    "README.md": {
        "file": {
            "contents": "# WIDEr Frontend\n\nThe frontend of WIDEr should offer the following:\n\n- simple project management capabilities\n- file up- and download\n- syntax highlighting\n- language client support\n- compilation\n- programming of attached device (maybe also simply a file upload service)\n- console / command line interface"
        }
    },
    "bundle.js": {
        "file": {
            "contents": "/*---------------------------------------------------------------------------------------------\n *  Copyright (c) Microsoft Corporation. All rights reserved.\n *  Licensed under the MIT License. See License.txt in the project root for license information.\n *--------------------------------------------------------------------------------------------*/\n\n//@ts-check\n\nconst esbuild = require('esbuild')\nconst path = require('path')\nconst fs = require('fs')\nconst { argv, exit } = require('process')\n\nremoveDir('dist', (entry) => /index.html$/.test(entry))\n\nconst workerEntryPoints = [\n    'vs/language/json/json.worker.js',\n    'vs/language/css/css.worker.js',\n    'vs/language/html/html.worker.js',\n    'vs/language/typescript/ts.worker.js',\n    'vs/editor/editor.worker.js'\n]\n\nbuild({\n    entryPoints: workerEntryPoints.map(\n        (entry) => `./node_modules/monaco-editor/esm/${entry}`\n    ),\n    bundle: true,\n    format: 'iife',\n    outbase: './node_modules/monaco-editor/esm/',\n    outdir: path.join(__dirname, 'dist')\n})\n\nesbuild\n    .context({\n        entryPoints: ['src/index.ts'],\n        bundle: true,\n        format: 'iife',\n        outdir: path.join(__dirname, 'dist'),\n        loader: {\n            '.ttf': 'file'\n        },\n        sourcemap: argv.includes('--dev'),\n        minify: !argv.includes('--dev')\n    })\n    .then((context) => {\n        if (argv.includes('--watch')) context.watch()\n        else context.rebuild().then(() => context.dispose())\n    })\n\n/**\n * @param {import ('esbuild').BuildOptions} opts\n */\nfunction build(opts) {\n    esbuild.build(opts).then((result) => {\n        if (result.errors.length > 0) {\n            console.error(result.errors)\n        }\n        if (result.warnings.length > 0) {\n            console.error(result.warnings)\n        }\n    })\n}\n\n/**\n * Remove a directory and all its contents.\n * @param {string} _dirPath\n * @param {(filename: string) => boolean} [keep]\n */\nfunction removeDir(_dirPath, keep) {\n    if (typeof keep === 'undefined') {\n        keep = () => false\n    }\n    const dirPath = path.join(__dirname, _dirPath)\n    if (!fs.existsSync(dirPath)) {\n        return\n    }\n    rmDir(dirPath, _dirPath)\n    console.log(`Deleted ${_dirPath}`)\n\n    /**\n     * @param {string} dirPath\n     * @param {string} relativeDirPath\n     * @returns {boolean}\n     */\n    function rmDir(dirPath, relativeDirPath) {\n        let keepsFiles = false\n        const entries = fs.readdirSync(dirPath)\n        for (const entry of entries) {\n            const filePath = path.join(dirPath, entry)\n            const relativeFilePath = path.join(relativeDirPath, entry)\n            if (keep && keep(relativeFilePath)) {\n                keepsFiles = true\n                continue\n            }\n            if (fs.statSync(filePath).isFile()) {\n                fs.unlinkSync(filePath)\n            } else {\n                keepsFiles = rmDir(filePath, relativeFilePath) || keepsFiles\n            }\n        }\n        if (!keepsFiles) {\n            fs.rmdirSync(dirPath)\n        }\n        return keepsFiles\n    }\n}\n"
        }
    },
